script: |
  super -f text -I q11188.spq | sort > q11188.out

inputs:
  - name: q11188.spq
    data: |
      SELECT DISTINCT - col2 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col2 / + col0 + - CAST ( NULL AS INTEGER ) + col1 BETWEEN + + ( - CAST ( + ( CAST ( NULL AS INTEGER ) ) AS INTEGER ) ) AND - - col2;
  - name: tab2

outputs:
  - name: q11188.out
    data: |
